const delays = [
    {
    name: "Singapore",
    dest: "Bangalore",
    speed: 0.2,
    holidays: "No"
    },
    {
    name: "Malaysia",
    dest: "Chennai",
    speed: 0.6,
    holidays: "No"
    },
];
export default delays;
